<!DOCTYPE html>
<html>
	<head>
		<title>Inkscape Output</title>
	</head>
	<body>
		<canvas id="canvas" width="100" height="100"></canvas>
		<script>
			var ctx = document.getElementById("canvas").getContext("2d");

			// #layer1

			// #path5-3
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.04444;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(93.332706, 49.493741);
			ctx.lineTo(4.999097, 49.499941);
			ctx.stroke();

			// #path1
			ctx.beginPath();
			ctx.strokeStyle = "rgb(0, 0, 0)";
			ctx.lineWidth = 1.0;
			ctx.lineCap = "butt";
			ctx.lineJoin = "miter";
			ctx.moveTo(64.582261, 34.552786);
			ctx.lineTo(94.582261, 49.552786);
			ctx.lineTo(64.582261, 64.552786);
			ctx.stroke();
		</script>
	</body>
</html>
